    // 删除所有上级元素的样式
    function webViewGetAllAncestors(element) {
        let parent = element.parentNode;
        while (parent && parent.nodeType === 1) { // 确保节点是元素节点
            parent.removeAttribute("class");
            parent.removeAttribute("style");
            parent = parent.parentNode;
        }
    }
    // 查找元素的函数的循环次数
    var webViewCounter = 0;

    // 查找全屏按钮
    function findWebViewButton() {
        // 最多循环10次
        if (webViewCounter > 10) {
            return;
        }
        // 查找元素全屏按钮
        const webViewButton = document.querySelector("#showplayerbox").shadowRoot.querySelector("div._tdp_fullbtn");
        if (webViewButton) {
            webViewCounter = 11;
            let video = document.querySelector("#showplayerbox").shadowRoot.querySelector("#hv_showplayerbox");
            // 自适应
            let meta = document.createElement("meta");
            meta.setAttribute("name", "viewport");
            meta.setAttribute("content", "width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=0");
            document.getElementsByTagName("head")[0].appendChild(meta);

            // 隐藏所有元素
            webViewGetAllAncestors(video);
            document.querySelector("html").style.visibility = "hidden";
            // 全屏  
            video.style.backgroundColor = "black";
            video.style.objectFit = "contain";
            video.style.position = "fixed";
            video.style.top = "0";
            video.style.right = "0";
            video.style.bottom = "0";
            video.style.left = "0";
            video.style.width = "100%";
            video.style.height = "100%";
            // 显示 video
            video.style.visibility = "visible";
            // 调整声音为最大，有些网站默认静音。
            video.volume = 1;
            // 播放视频，有些网站默认不自动播放视频。
            video.play();
            // 隐藏进度条
            document.querySelector("#showplayerbox").shadowRoot.querySelector("div._tdp_contrl").style.opacity = 0;
            // 通知flutter
            window.webViewToFlutter.postMessage("加载完毕");
            return;
        }
        // 循环次数+1
        webViewCounter++;
        // 递归方式等待一秒后调用自己
        setTimeout(findWebViewButton, 1000);
    }
    findWebViewButton();

